Los desarrolladores Infinity Ward y los editores Activision presentan la nueva entrada en la serie COD Call Of Duty Modern Warfare II - Vault Edition Código de Xbox Live, donde tendrás que participar una vez más en un conflicto global sin precedentes. En este juego volverán todos tus personajes favoritos de la Task Force 141, así que si eres fan de la serie, estarás contento. Desde misiones de infiltración táctica a pequeña escala hasta objetivos especialmente secretos, los jugadores, junto con sus amigos, se sumergirán en una experiencia muy envolvente. El juego también ofrece una jugabilidad de la máxima calidad, junto con un manejo de las armas completamente renovado, un sistema de IA mejorado, la mejora de las armas y algunas otras innovaciones en los departamentos de jugabilidad y gráficos para elevar la serie a nuevas cotas. Podrás disfrutar de la campaña del juego para un solo jugador, así como de las batallas online, o de la campaña cooperativa Special Ops, basada en la historia.
Call Of Duty Modern Warfare II - Vault Edition Código de Xbox Live trae un juego FPS multijugador para tu completo entretenimiento. Un caos total e indomable, múltiples descargas de adrenalina y una furiosa tormenta de balas, gases y granadas te esperan en cada batalla: ¿estás preparado para el enfrentamiento definitivo entre el eje del poder? ¡Únete a la batalla entre los hombres sobre cuyos hombros descansa nuestro futuro!
