Nuevo modo cooperativo
¡Sumérgete en la acción táctica más candente y sin complejos junto a tu amigo! Coopera y juega en línea en numerosas misiones contrarreloj y basadas en objetivos. Con cada partida, ¡desbloquearás misiones más duras, más exigentes y más difíciles! Con Call Of Duty Modern Warfare II - Vault Edition Código de Xbox Live podrás volver a experimentar los favoritos de los fans de la iteración anterior, ¡así como las nuevas y exclusivas pruebas!
